Tweet_Origin:
ההיסטוריה הטילה עלינו תפקיד קיומי: לזכור ולהזכיר לעולם את שואת עמנו, ולהילחם במי שמערערים על זכות קיומנו במדינת ישראל.

היום, בשבוע בו חל יום הזיכרון הבינלאומי לקורבנות השואה, הבאנו לישיבת הממשלה שתי החלטות חשובות בעניין זה:

- הגדלת השתתפות המדינה בתקציב "יד ושם" בכ-30 מיליון &gt;&gt;

לפני 80 שנה, ב-20 בינואר 1942, התכנסה קבוצה של בכירים גרמנים בוילת ואנזה בגרמניה על מנת לתכנן ולסגור את פרטי השמדת העם היהודי.  

מסביב לשולחן, כמו פגישת עבודה אופיינית, בקור רוח, הם תכננו את השואה, האירוע מעשה-האדם הנורא בתולדות האנושות. 

בסך הכל 80 שנה עברו. &gt;&gt;

אבל, ברמה הערכית, זוהי בדיוק רוח הלחימה הנדרשת ממפקדים בצה״ל. 
ואת הרוח הזו, של יוזמה, של אהבת הארץ, של חתירה למגע, יש לחזק, לא לכבות. 

אשרי העם שאלו הם מפקדיו. &gt;&gt;

ההתעצמות הזו חשובה לקיומנו, ואני מאוד שמח עליה ונחוש להשלים אותה מהר.

בראש רשימת האתגרים שלנו ניצבת איראן. אנחנו עושים פה שינוי לתפיסה של מתקפה רציפה, ולא רק מגננה רציפה. 
ביחס לשיחות הגרעין בוינה, חשוב לי להבהיר בצורה שלא משתמעת לשתי פנים: ישראל איננה צד להסכמים, ישראל &gt;&gt;

כפי שהיינו ראשונים עם הבוסטרים. 
ההיענות עצומה – כמעט רבע מליון(!) כבר קיבלו בוסטר שני, בדיוק אלה שהכי זקוקים לעוד שכבת הגנה. 

כשעומדים בתור קשה לראות את ההצלחות וצעדי ההערכות שעשינו, צעדים חשובים ביותר שיצילו חיים. אני מבין את התסכול, אבל מבקש מכם להיות מודעים גם לזה. &gt;&gt;

האפשר, ולהגן על הפגיעים ביותר - המבוגרים, החולים, כל מי שנמצא בסיכון גדול לפתח מחלה קשה ולהגיע לאשפוז בבית החולים. 
זה לא קל, אבל נערכנו ככל הניתן בזמן שקנינו, ואלה הפעולות שעשינו עד כה: 
• דאגנו למלאי תרופות, של פייזר ושל מרק, שיתנו מענה לאלה שבסיכון גדול להגיע למצב קשה. &gt;&gt;

גל האומיקרון איתנו וכמו שכולכם מרגישים הוא מדבק בכל הכח.

אגש ישר לבעיה שמטרידה כמעט כל בית בישראל - הבדיקות. &gt;&gt;

https://t.co/hPEjZIqSVd

כשבעל עסק מחליט לפתוח מפעל, יש לו אפשרות לעשות זאת כאן בארץ, או בכל מקום אחר בעולם. 

בהחלטת הממשלה שאנחנו מקבלים היום, אנחנו בעצם אומרים לתעשיינים: תישארו בבית. אנחנו רוצים אתכם כאן.

זו בשורה גדולה לכלכלה כולה. כל מפעל שנפתח כאן, משמעותו עוד מאות מקומות עבודה בישראל. &gt;&gt;

בעלי עסקים — עוד דבר גדול בשבילכם. 

היום נביא לאישור רפורמה שתיתן דחיפה אדירה לתעשייה הישראלית. 

בעיקרה - משך זמן הקמת מפעל יקוצר ב-50% (כיום עומד על כחמש שנים), זמן הנפקת ההיתרים יופחת ב-50% ומשך זמן הוצאת היתר בנייה יצומצם משנתיים ל-3 חודשים בלבד לאחוז גדול מהבקשות. &gt;&gt;

